description:
[Blacksonblondes] 05.26.15 Nina Hartley [Hillary Earns The Black Vote][SD] [.mp4]

First, it was the Donald Sterling scandal. Next up, Orange is the New Blacks on Blondes. And for Dogfart's latest parody, Nina Hartley plays Hillary Clinton, and today we're going to watch as she fields questions from what she feels might be her most important demographic: the 18 - 35 year-old African-American male. The goal, of course, is to do whatever it takes the win the vote. After the group is dismissed, Hillary's going to show you how she plans to become the most powerful person of the free world. 

